sources.styles/_reset.scss:
html,
body,
ul,
li,
input,
button,
textarea,
h1,
h2,
h3,
h4,
h5,
h6 {
  margin: 0;
  padding: 0;
  border-width: 0;
  font-family: "Ubuntu", sans-serif;
  font-size: 16px;
  line-height: inherit;
}

body {
  line-height: 1.5;
}

strong {
  font-weight: 500;
}

sources.styles/_link.scss:
.link {
  color: $highlight-color;
  text-decoration: none;
  transition: color $hover-duration;

  &:hover {
    color: $highlight-hover-color;
  }
}

sources.styles/_header.scss:
.header {
  height: 100vh;
  background: url("../images/header.jpg") center;
  background-size: cover;
  position: relative;
  font-weight: 400;
  line-height: 1;

  &__nav {
    position: absolute;
    bottom: 25px;
    left: 0;
    right: 0;
  }

  &__top {
    position: absolute;
    top: 35px;
    left: calc(50% - #{$logo-width / 2});
    display: flex;
    color: white;
  }

  &__number {
    color: #fff;
    text-decoration: none;
    transition: color 0.2s;

    &:hover {
      color: $active-color;
    }
  }

  &__phone {
    margin: 0 82px;
  }

  &__phone,
  &__action {
    position: relative;
    top: 47px;
  }

  &__link {
    color: white;
    text-decoration: none;
    border-bottom: 1px dashed;
    transition: color $hover-duration;
    text-transform: uppercase;

    &:hover {
      color: $active-color;
    }
  }
}

@media screen and (max-width: $small-screen-breakpoint) {
  .header {
    &__top {
      flex-direction: column;
    }
    &__phone {
      margin: -30px 0 10px;
    }
  }
}

sources.styles/_nav.scss:
.nav {
  color: black;
  text-transform: uppercase;

  &__list {
    display: flex;
    justify-content: center;
    list-style: none;
  }

  &__item {
    padding: 7px 20px;
    margin: 0 22.5px;
    border-radius: 10px;

    &-active {
      background-color: $active-color;
    }
  }

  &__link {
    color: white;
    text-decoration: none;
    transition: color $hover-duration;

    &:hover {
      color: $active-color;
    }
  }
}

@media screen and (max-width: $small-screen-breakpoint) {
  .nav__list {
    flex-direction: column;
    align-items: center;
  }
}

sources.styles/_logo.scss:
.logo {
  width: $logo-width;
  height: $logo-height;
  background-image: url("../images/logo.png");
  background-size: contain;
  background-repeat: no-repeat;
  background-position: center;
}

sources.styles/_section.scss:
.section {
  position: relative;
  padding: 100px calc(50% - 470px);
  background: white;

  &:nth-child(even) {
    background-color: $c-gray;
  }

  &__heading {
    left: 0;
    right: 0;
    top: -0.5em;
    margin: auto;
  }

  &__content {
    width: 100%;
  }
}

@media screen and (max-width: $small-screen-breakpoint) {
  .section {
    padding-left: 40px;
    padding-right: 40px;
  }
}

sources.styles/_info.scss:
.info {
  display: flex;
  justify-content: space-between;

  &__heading {
    width: 314px;
    font-weight: 300;
    text-transform: uppercase;
    line-height: 60px;
    font-size: 48px;
  }

  &__text {
    max-width: 564px;

    &--first {
      margin-top: 0;
    }

    &--last {
      margin-bottom: 0;
    }
  }
}

sources.styles/_heading.scss:
.heading {
  font-size: 48px;
  line-height: 1;
  position: absolute;
  text-transform: uppercase;
  font-weight: 300;
  width: max-content;

  &::before,
  &::after {
    display: block;
    content: "";
    position: absolute;
    height: 2px;
    top: calc(100% + 5px);
    width: calc(50% - 20px);
    background-color: $highlight-color;
  }

  &::before {
    left: 0;
  }

  &::after {
    right: 0;
  }

  &__crown {
    display: block;
    position: absolute;
    left: 0;
    right: 0;
    width: 20px;
    height: 13px;
    top: calc(100% + 4px);
    margin: auto;
    background-image: url("../images/crown.svg");
  }
}

sources.styles/_photos.scss:
.photos {
  $gap: 20px;
  display: flex;
  justify-content: space-between;

  &__img {
    width: calc(50% - #{$gap / 2});
    height: 260px;
    object-fit: cover;
    object-position: center;
    transition: transform 0.5s, box-shadow 0.5s;

    &:hover {
      transform: scale(1.03);
      box-shadow: 0 0 10px rgba(0,0,0,0.5);
    }
  }

  &--wide-left {
    .photos__img {
      &:first-child {
        width: calc(67% - #{$gap / 2});
      }

      &:last-child {
        width: calc(33% - #{$gap / 2});
      }
    }
  }

  &--wide-right {
    .photos__img-right {
      &:first-child {
        width: calc(33% - #{$gap / 2});
      }

      &:last-child {
        width: calc(67% - #{$gap / 2});
      }
    }
  }
}

sources.styles/_button.scss:
.button {
  display: block;
  font-size: 14px;
  line-height: 1;
  color: white;
  background-color: $highlight-color;
  cursor: pointer;
  transition: background-color $hover-duration;
  padding: 19px 62px;
  text-transform: uppercase;

  &:hover {
    background-color: $highlight-hover-color;
  }
}

sources.styles/_consultation.scss:
.consultation {
  display: flex;
  justify-content: space-between;

  &__text {
    width: 480px;
  }

  &__heading {
    font-size: 32px;
    line-height: 40px;
    margin-bottom: 24px;
  }

  &__form {
    width: 380px;
  }
}

@media screen and (max-width: $small-screen-breakpoint) {
  .consultation {
    flex-direction: column;

    &__text,
    &__form {
      width: 100%;
    }
  }
}

sources.styles/_form.scss:
.form {
  display: flex;
  flex-direction: column;

  &__input,
  &__button {
    display: block;
    margin-bottom: 8px;
    box-sizing: border-box;
    width: 100%;
  }
}

sources.styles/_input.scss:
.input {
  font-size: 14px;
  font-weight: 500;
  text-align: center;
  color: #393939;
  padding: 24px;
  background-color: $c-gray;
  box-sizing: border-box;
  text-transform: uppercase;
  line-height: 1;

  &::placeholder {
    color: inherit;
  }

  &__textarea {
    height: 166px;
  }
}

@media screen and (max-width: $small-screen-breakpoint) {
  .info {
    flex-direction: column;

    &__heading {
      margin-bottom: 16px;
    }
  }
}

sources.styles/_testimonials.scss:
.testimonials {
  display: grid;
  justify-content: center;
  gap: 65px;
  grid-template-columns: repeat(3 , 200px);
}

@media screen and (max-width: $small-screen-breakpoint) {
  .testimonials {
    grid-template-columns: repeat(1 , 200px);
  }
}

sources.styles/_person.scss:
.person {
  text-align: center;

  &__photo {
    width: 150px;
    height: 150px;
    border-radius: 50%;
    transition: box-shadow 0.5s;

    &:hover {
      box-shadow: 0 0 10px rgba(0,0,0,0.5);
    }
  }

  &__name {
    margin-top: 12px;
    font-weight: bold;
  }

  &__position {
    margin: 0;
    color: #696973;
    font-style: italic;
  }

  &__text {
    position: relative;

    &:after {
      content: "";
      position: absolute;
      display: block;
      width: 40px;
      height: 33px;
      background-image: url("../images/quotes.svg");
      background-size: contain;
      background-repeat: no-repeat;
      background-position: center;
      right: calc(100% + 6px);
      bottom: calc(100% + 6px);
    }
  }
}

sources.styles/_contact.scss:
.contact {
  display: flex;
  justify-content: space-between;

  &__text {
    font-size: 24px;
    width: 280px;
  }

  &__address {
    color: black;
    text-decoration: none;
  }

  &__phone {
    color: black;
    text-decoration: none;
  }

  &__form {
    width: 380px;
  }
}

@media screen and (max-width: $small-screen-breakpoint) {
  .contact {
    flex-direction: column;
    &__text,
    &__form {
      width: 100%;
    }
  }
}

sources.styles/_footer.scss:
.footer {
  height: 540px;
  position: sticky;
  bottom: 0;
  z-index: -1;
  background-image: url("../images/footer.jpg");
  background-size: cover;
  background-position: center;

  &__logo {
    position: absolute;
    left: 0;
    right: 0;
    margin: auto;
    bottom: 95px;

  }
}
